/**
 * @param {character[][]} grid
 * @return {number}
 */
var numIslands = function(grid) {
  let islands = 0;
  let knownNodes = grid.map((subgrid) => {
    return subgrid.map(() => false);
  });
  
  for(currentVerticalPosition = 0; currentVerticalPosition < grid.length; currentVerticalPosition++) {
    for(currentHorizontalPosition = 0; currentHorizontalPosition < grid[0].length; currentHorizontalPosition++) {
      if (grid[currentVerticalPosition][currentHorizontalPosition] !== '0') {
        // check if current position isn't a part of some graph that has already been extracted
        if (!knownNodes[currentVerticalPosition][currentHorizontalPosition]) {
          // if that's unknown node, then that means that we've encountered an unknown island.
          // increment islands amount
          islands++;
          
          // extract full graph and store it to knownNodes map
          dfs(grid, currentVerticalPosition, currentHorizontalPosition, knownNodes);
        }
      }
    }
  }
  
  return islands;
};

function dfs(grid, verticalIndex, horizontalIndex, knownNodes) {
  knownNodes[verticalIndex][horizontalIndex] = true;
  const neightbours = [];

  // Checking top neighbor
  if (isValidNeighbor(grid, verticalIndex - 1, horizontalIndex)) {
    neightbours.push([verticalIndex - 1, horizontalIndex]);
  }

  // Checking right neighbor
  if (isValidNeighbor(grid, verticalIndex, horizontalIndex + 1)) {
    neightbours.push([verticalIndex, horizontalIndex + 1]);
  }

  // Checking bottom neighbor
  if (isValidNeighbor(grid, verticalIndex + 1, horizontalIndex)) {
    neightbours.push([verticalIndex + 1, horizontalIndex]);
  }

  // Checking left neighbor
  if (isValidNeighbor(grid, verticalIndex, horizontalIndex - 1)) {
    neightbours.push([verticalIndex, horizontalIndex - 1]);
  }

  for (let i = 0; i < neightbours.length; i++) {
    if (!knownNodes[neightbours[i][0]][neightbours[i][1]]) {
      dfs(grid, neightbours[i][0], neightbours[i][1], knownNodes);
    }
  }
}

function isValidNeighbor(grid, verticalIndex, horizontalIndex) {
  const verticalIndexLimit = grid.length - 1;
  const horizontalIndexLimit = grid[0].length - 1;
  
  if (verticalIndex < 0 || verticalIndex > verticalIndexLimit) {
    return false;
  }

  if (horizontalIndex < 0 || horizontalIndex > horizontalIndexLimit) {
    return false;
  }

  if (grid[verticalIndex][horizontalIndex] !== '1') {
    return false;
  }

  return true;
}

